function prettyDisplayTime(seconds) {
  let displayMinutes = Math.floor(Seconds / 60);
  let displaySeconds = Math.floor(Seconds % 60);
  let timerDisplay =
    displaySeconds < 10
      ? `${minutes}:0${displaySeconds}`
      : `${displayMinutes}:${displaySeconds}`;
}

export { prettyDisplayTime };
